script: |
  super -f text -I q9358.spq | sort > q9358.out

inputs:
  - name: q9358.spq
    data: |
      SELECT - col2 - - col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( ( - col2 * - - ( + col1 ) + - col0 * col2 NOT BETWEEN + col0 AND + - 1 * - + col1 * - col0 ) );
  - name: tab1

outputs:
  - name: q9358.out
    data: |
